//get items from axios
import axios from "axios";
import { useEffect, useState } from "react";
type ItemType = {
    itemId: string;
    name: string;
    description: string;
    price: number;
    image: string;
};
const fetch = "http://localhost:8080/api/menu/getAllMenu";
export default function GetItems() {
    const [items, setItems] = useState<ItemType[]>([]);
    const fetchData = async () => {
        const { data } = await axios.get(fetch);
        console.log(data);
        setItems(data);
    };
    useEffect(() => {
        fetchData();
    }, []);
    return (
        <div>
            {items.map((item) => (
                <div key={item.itemId}>
                    <img src={item.image} alt="item" />
                    <h1>{item.name}</h1>
                    <p>{item.description}</p>
                    <p>{item.price}</p>
                </div>
            ))}
        </div>
    );
}
